import axios from "axios";

const getAllTodo = (setTodoList) => {
    axios('todo/', {
        method: "GET",
    }).then((res) => {
        // console.log([...res.data][0]._id);
        setTodoList( [...res.data] );
    }).catch((err) => {
        console.log(err.message);
    });
}

export default getAllTodo;
